function About() {
    return(
        <div>
            <h2>Somos</h2>
            <p>Una empresa dedicada a proporcionar soluciones tecnológicas con el objetivo de elevar la calidad del software en Latinoamérica</p>
            <h2>¿Que hacemos?</h2>
            <p>Desarrollamos software de calidad con las mejores tecnologías para nuestros clientes aumenten su productividad.</p>
            <h2>Mision</h2>
            <p>En Ax01, nos dedicamos a proporcionar soluciones tecnológicas que encarnan nuestra filosofía de simplicidad, permitiendo a todos abordar desafíos complejos de manera más simple y efectiva. Nos esforzamos por transformar la forma en que las personas enfrentan los retos diarios a través de soluciones duraderas, adaptables y fáciles de usar. Nuestra misión es empoderar a las personas y organizaciones, ofreciendo soluciones tecnológicas que simplifican la vida y fomentan la eficacia en un mundo en constante cambio.”</p>
        </div>
    )

}

export default About;
